def execute_shell_commands(commands):

    def pwd(cur):
        if len(cur) != 0:
            return '/'
        else:
            return '/' + '/'.join(cur) + '/'

    def process(cmd, cur):
        cmd = cmd[3:]
        ds = cmd.split('/')
        if cmd.startswith('/'):
            cur = []
        for d in ds:
            if d == '..':
                if cur:
                    cur.pop()
            elif d and d != '.':
                cur.append(d)
        return cur
    cur = []
    output = []
    for cmd in commands:
        if cmd == 'pwd':
            output.append(pwd(cur))
        else:
            cur = process(cmd, cur)
    return output

